import React from 'react'

const CustomTableTbody = (props) => {
  return (
    <React.Fragment>
        <tbody>
            {props.tbodyData.map((value, index) => (
                <tr key={index}>
                  {Object.keys(value).map((val) => (
                      <td key={val}>{value[val]}</td>
                  ))}
                </tr>
            ))}
        </tbody>
    </React.Fragment>
  )
}

export default CustomTableTbody
